                </div>
                <h2 style=""text-align:center;""><b>Welcome to Python Course</b></h2>
                <hr />

                <h1 class=""font-weight-bold"">What is Python?</h1>
                <div>Python is a popular programming language. It was created by Guido van Rossum, and released in 1991.</div><br>
                <p>It is used for:</p><br>
                <ul>
                    <li>web development (server-side),</li>
                    <li>software development,</li>
                    <li>mathematics,</li>
                    <li>system scripting.</li>
                </ul>
                <br>
                <h1 class=""font-weight-bold"">What can Python do?</h1><br>
                <ul>
                    <li>Python can be used on a server to create web applications.</li>
                    <li>Python can be used alongside software to create workflows.</li>
                    <li>Python can connect to database systems. It can also read and modify files.");
                WriteLiteral(@"</li>
                    <li>Python can be used to handle big data and perform complex mathematics.</li>
                    <li>Python can be used for rapid prototyping, or for production-ready software development.</li>
                </ul><br>

                <h1 class=""font-weight-bold"">Why Python?</h1><br>
                <ul>
                    <li>Python works on different platforms (Windows, Mac, Linux, Raspberry Pi, etc).</li>
                    <li>Python has a simple syntax similar to the English language.</li>
                    <li>Python has syntax that allows developers to write programs with fewer lines than some other programming languages.</li>
                    <li>Python runs on an interpreter system, meaning that code can be executed as soon as it is written. This means that prototyping can be very quick.</li>
                    <li>Python can be treated in a procedural way, an object-oriented way or a functional way.</li>
                </ul><br>

                ");
                WriteLiteral(@"<h1 class=""font-weight-bold"">Good to know</h1><br>
