                <h1 class=""font-weight-bold"">Python Syntax compared to other programming languages</h1><br>
                <ul>
                    <li>Python was designed for readability, and has some similarities to the English language with influence from mathematics.</li>
                    <li>Python uses new lines to complete a command, as opposed to other programming languages whi");
